import React from 'react';
import axios from 'axios'
import fetch from 'node-fetch'


const Index = ({ props }) => {
    return (
        <div>
            <h4>teffsfft</h4>
        </div>
    );
}

export async function getStaticProps(context) {

    try {
        const res = await axios.get("https://localhost:3000/projects");
        const proj = res.data;
    } catch (err) {
        console.log(err)
    }

    
    return {
        props: {
            proj
        }
    }
}

export default Index;


